import React from 'react';
import './Logo.css';
import Media from 'react-media';
import { TweenMax, Expo } from 'gsap';
import { useNavigate } from 'react-router-dom';

// Return logo view
export default function REturnLogo() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {
 return (
  <div className='wrp-logo-lastfx'>
   <ViewText />
  </div>
 )
};
export const ScreenSmall = () => {
 return (
  <div className='wrp-logo-lastfx-sm'>
   <ViewText />
  </div>
 )
};

export const ViewText = () => {
 React.useEffect(() => {
  TweenMax.from('.Anime', 1.4, { delay: 1.5, opacity: 0, y: 5, ease: Expo.easeIn });

 }, []);

 const navigation = useNavigate();
 const handlepath = (event) => {
  event.preventDefault();
  navigation('/dash');
 };

 return (
  <div onClick={handlepath} className='Anime'>
   <img src={'/img/logo.png'} alt={'logo view '} />
  </div>
 )
}
